<script type=""text/javascript"">
    function searchOneNews() {
        var keyword = $(""#keyword"").val();
        if (keyword != """" && keyword != null) {
            $.ajax({
                type: 'get',
                url: '/Home/SearchOneNews',
                data: { keyword: keyword },
                success: function (data) {
                    if (data.code == 200) {
                        window.open(""/News/Detail?id="" + data.data);
